import React from "react";
import LogIn from "../components/LogIn";
import image from "../components/Images/CatDog.png";

function Home() {
  return (
    <div className="pageCard row">
      <div className="col-12 col-md-6">
        <h2 className="titleFont">Pet</h2>
        <h2 className="titleFont">Friend.ly</h2>

        <p className="bg-dark">LogIn Form</p>
      </div>
      <div className="bg-dark col-12 col-md-6">
        <img src={image} alt=""></img>
      </div>
    </div>
  );
}

export default Home;
